import React from "react";
import "./footer.css";
function Footer() {
  return (
    <>
      <div className="footer">Made with ❤️ in Mumbai</div>
      <div className="contantdetail">
        <p className="blac">
          <a href="https://www.freepik.com/vectors/developer">
            Developer vector created by storyset - www.freepik.com
          </a>
        </p>
      </div>
    </>
  );
}

export default Footer;
